#!/bin/python3
from typing import List


def find_anagrams(s: str, p: str) -> List[int]:
    """
    https://leetcode.com/problems/find-all-anagrams-in-a-string/
    time complexity: O(n)
    space complexity: O(1)
    :param s:
    :param p:
    :return:
    """
    lenP = len(p)
    res: List[int] = []
    # count the frequency of letters
    signature = dict()
    for c in p:
        signature[c] = signature.get(c, 0) + 1

    letterCount = dict()
    for i in range(len(s) - lenP + 1):
        if i == 0:
            for y in range(lenP):
                letterCount[s[y]] = letterCount.get(s[y], 0) + 1
        else:
            # remove the first letter and add next letter
            first = s[i - 1]
            last = s[i + lenP - 1]
            letterCount[first] = letterCount.get(first, 0) - 1
            if letterCount.get(first) <= 0:
                del letterCount[first]
            letterCount[last] = letterCount.get(last, 0) + 1
        if (letterCount == signature):
            res.append(i)
    return res


if __name__ == '__main__':
    assert find_anagrams("cbaebabacd", "abc") == [0, 6]
    assert find_anagrams("abab", "ab") == [0, 1, 2]
    assert find_anagrams(
        "",
        "") == [
               0, 10001]
